import React from 'react'
import { worshipHands } from '../../assets/worshipHands';

export const Home = () => {
    return (
        <div className="container">
            <div className="jumbotron text-center" style="background: url(`{worshipHands}) no-repeat center center fixed; -webkit-background-size: cover; -moz-background-size: cover; -o-background-size: cover; background-size: cover;">
                <h1>Home Page</h1>
            </div>

        </div>
    )
}
